use reqwest;
use tokio;
use clipboard;
use tts;

#[tokio::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> {
    // Set up elevenlabs.io API credentials
    let api_key = "YOUR_API_KEY_HERE";
    let api_secret = "YOUR_API_SECRET_HERE";

    // Set up TTS engine
    let tts_engine = tts::Engine::new("espeak")?;

    // Get clipboard contents
    let clipboard_contents = clipboard::get_text()?;

    // Create API request to elevenlabs.io
    let client = reqwest::Client::new();
    let response = client.post("https://api.elevenlabs.io/v1/tts")
        .header("Authorization", format!("Bearer {}", api_key))
        .header("Content-Type", "application/json")
        .json(&json!({
            "text": clipboard_contents,
            "voice": "en-US",
            "speed": 1.0,
            "pitch": 1.0,
        }))
        .send()
        .await?;

    // Check if response was successful
    if response.status().is_success() {
        // Get audio data from response
        let audio_data = response.bytes().await?;

        // Play audio data using TTS engine
        tts_engine.play(audio_data)?;
    } else {
        eprintln!("Error: {}", response.status());
    }

    Ok(())
}
